import React from "react";
import { useNavigate } from "react-router-dom";

const Login = () => {
    const navigate = useNavigate();
    return (
        <div id="login__container">
            <h1>Login page</h1>
            <button onClick={() => { navigate('/Main') }}>Main</button>
        </div>
    );
}

export default Login;
